import React from "react";
import "../App.css"

function addRecipe() {
    return (
        <div>
            <h3>New Recipe</h3>
            <form>
                <label>Recipe Name</label>
                <input type="text" name="recipe" required></input>
                <label>Ingredients</label>
                <textarea required name="ingredients"></textarea>
                <label>Directions</label>
                <textarea required name="directions"></textarea>
                <button>Submit</button>
            </form>
        </div>
    );
}
export default addRecipe;
